@return Result of the CreateJob operation returned by the service.
@throws MissingParameterException One or more required parameters was missing from the request.
@throws InvalidParameterException One or more parameters had an invalid value.
@throws InvalidAccessKeyIdException The AWS Access Key ID specified in the request did not match the manifest's accessKeyId value. The manifest and the request authentication must use the same AWS Access Key ID.
@throws InvalidAddressException The address specified in the manifest is invalid.
@throws InvalidManifestFieldException One or more manifest fields was invalid. Please correct and resubmit.
@throws MissingManifestFieldException One or more required fields were missing from the manifest file. Please correct and resubmit.
@throws NoSuchBucketException The specified bucket does not exist. Create the specified bucket or change the manifest's bucket, exportBucket, or logBucket field to a bucket that the account, as specified by the manifest's Access Key ID, has write permissions to.
@throws MissingCustomsException One or more required customs parameters was missing from the manifest.
@throws InvalidCustomsException One or more customs parameters was invalid. Please correct and resubmit.
@throws InvalidFileSystemException File system specified in export manifest is invalid.
@throws MultipleRegionsException Your manifest file contained buckets from multiple regions. A job is restricted to buckets from one region. Please correct and resubmit.
